import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

import CardInfo from '../components/CardInfo.js';

function Card(props) {
    return (
        <Link className="d-inline-block project-card" to={props.item.path} onClick={(e) => props.click(props.item)} style={{ textDecoration: 'none', color: 'black'}}>
            <Route path="/" exact render={() => <HomePage title={this.state.home.title} subTitle={this.state.home.subTitle}/>} />
            <img className="project-card-image" src={props.item.imgSrc} alt={props.item.imgSrc} />
            <CardInfo title={props.item.title} subTitle={props.item.subTitle} roles={props.item.roles} path={props.item.path} />
        </Link>
    );
}

export default Card;
